text = ''
   
for x in range(32):
    for y in range(32):
        blocks = []
        start_val = 32
        for i in range(len(text)):
            if start_val == 32:
                blocks.append(text[i:i+32])
                start_val = 0
            start_val += 1

        pairs = {}
        
        for block in blocks:
            pairs.update({f'{block[x]}{block[y]}' : 0})
        for block in blocks:
            pairs[f'{block[x]}{block[y]}'] += 1
        t = 0
        for pair in pairs:
            t += pairs[pair]
    
        result = [f"({x}, {y}){pair} = {(int(pairs[pair]) / t * 100):.1f} %" for pair in pairs]
        
        if x != y and len(result) < 50:
            print(result)
            print()